-- ----------------------------
-- View structure for v_act_hi_procinst
-- ----------------------------
DROP VIEW IF EXISTS `v_act_hi_procinst`;
CREATE ALGORITHM = UNDEFINED DEFINER = `root`@`localhost` SQL SECURITY DEFINER VIEW `v_act_hi_procinst` AS select `pe`.`ID_` AS `PROC_INST_ID_`,`pe`.`BUSINESS_KEY_` AS `BUSINESS_KEY_`,`pe`.`PROC_DEF_ID_` AS `PROC_DEF_ID_`,`pe`.`KEY_` AS `PROCESS_DEFINITION_KEY_`,`pdf`.`FULL_ID` AS `PROC_FULL_ID`,`pdf`.`FULL_NAME` AS `PROC_FULL_NAME`,`pdf`.`NAME` AS `PROC_NAME`,substr(`pdf`.`FULL_NAME`,2,locate('/',substr(`pdf`.`FULL_NAME`,1))) AS `PROC_SYS_NAME`,`pe`.`START_TIME_` AS `START_TIME_`,`pe`.`END_TIME_` AS `END_TIME_`,`pe`.`APPLICANT_PERSON_MEMBER_ID_` AS `APPLICANT_PERSON_MEMBER_ID_`,`pe`.`APPLICANT_PERSON_MEMBER_NAME_` AS `APPLICANT_PERSON_MEMBER_NAME_`,`pe`.`APPLICANT_DEPT_NAME_` AS `APPLICANT_DEPT_NAME_`,`pe`.`APPLICANT_ORG_NAME_` AS `APPLICANT_ORG_NAME_`,`pe`.`STATUS_ID_` AS `PROC_STATUS_ID_` from (`wf_procdef` `pdf` left join (`act_hi_procinst_extension` `pe` join `act_re_procdef` `pd` on((`pe`.`PROC_DEF_ID_` = `pd`.`ID_`))) on((`pd`.`KEY_` = `pdf`.`PROC_ID`))) where (`pdf`.`NODE_KIND_ID` = 'proc');

-- ----------------------------
-- View structure for v_sa_oporg_exclude_pos
-- ----------------------------
DROP VIEW IF EXISTS `v_sa_oporg_exclude_pos`;
CREATE ALGORITHM = UNDEFINED DEFINER = `root`@`localhost` SQL SECURITY DEFINER VIEW `v_sa_oporg_exclude_pos` AS select `sa_oporg`.`ID` AS `ID`,`sa_oporg`.`TYPE_ID` AS `TYPE_ID`,`sa_oporg`.`CODE` AS `CODE`,`sa_oporg`.`NAME` AS `NAME`,`sa_oporg`.`LONG_NAME` AS `LONG_NAME`,(case `sa_oporg`.`ORG_KIND_ID` when 'psm' then `sa_oporg`.`DEPT_ID` else `sa_oporg`.`PARENT_ID` end) AS `PARENT_ID`,`sa_oporg`.`FULL_ID` AS `FULL_ID`,`sa_oporg`.`FULL_CODE` AS `FULL_CODE`,`sa_oporg`.`FULL_NAME` AS `FULL_NAME`,`sa_oporg`.`ORG_KIND_ID` AS `ORG_KIND_ID`,`sa_oporg`.`DEPTH` AS `DEPTH`,`sa_oporg`.`PERSON_ID` AS `PERSON_ID`,`sa_oporg`.`NODE_KIND_ID` AS `NODE_KIND_ID`,`sa_oporg`.`DESCRIPTION` AS `DESCRIPTION`,`sa_oporg`.`STATUS` AS `STATUS`,`sa_oporg`.`SEQUENCE` AS `SEQUENCE`,`sa_oporg`.`VERSION` AS `VERSION`,`sa_oporg`.`ORG_CODE` AS `ORG_CODE`,`sa_oporg`.`DEPT_CODE` AS `DEPT_CODE`,`sa_oporg`.`POSITION_CODE` AS `POSITION_CODE`,`sa_oporg`.`PERSON_MEMBER_CODE` AS `PERSON_MEMBER_CODE`,`sa_oporg`.`IS_CENTER` AS `IS_CENTER`,`sa_oporg`.`CENTER_CODE` AS `CENTER_CODE`,`sa_oporg`.`ORG_ID` AS `ORG_ID`,`sa_oporg`.`DEPT_ID` AS `DEPT_ID`,`sa_oporg`.`POSITION_ID` AS `POSITION_ID`,`sa_oporg`.`PERSON_MEMBER_ID` AS `PERSON_MEMBER_ID`,`sa_oporg`.`CENTER_ID` AS `CENTER_ID`,`sa_oporg`.`ORG_NAME` AS `ORG_NAME`,`sa_oporg`.`DEPT_NAME` AS `DEPT_NAME`,`sa_oporg`.`POSITION_NAME` AS `POSITION_NAME`,`sa_oporg`.`PERSON_MEMBER_NAME` AS `PERSON_MEMBER_NAME`,`sa_oporg`.`CENTER_NAME` AS `CENTER_NAME`,`sa_oporg`.`FULL_SEQUENCE` AS `FULL_SEQUENCE`,`sa_oporg`.`FULL_ORG_KIND_ID` AS `FULL_ORG_KIND_ID`,`sa_oporg`.`IS_VIRTUAL` AS `IS_VIRTUAL` from `sa_oporg` where (`sa_oporg`.`ORG_KIND_ID` <> 'pos');

-- ----------------------------
-- Function structure for next_sequence
-- ----------------------------
DROP FUNCTION IF EXISTS `next_sequence`;
delimiter ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `next_sequence`(seq_name VARCHAR(128)) RETURNS bigint(20)
    DETERMINISTIC
BEGIN

DECLARE val BIGINT;


SET val = 0;

SELECT
	next_val INTO val
FROM
	hibernate_sequences
WHERE
	sequence_name = seq_name;

UPDATE hibernate_sequences
SET next_val = next_val + 1
WHERE
	sequence_name = seq_name;

RETURN val;
END
;;
delimiter ;

SET FOREIGN_KEY_CHECKS = 1;
